import HeaderInfo from '../molecules/HeaderInfo';
import WebsiteBuilder from '../molecules/WebsiteBuilder';
import { Container } from 'theme-ui';
import WebsiteBuilderCards from '../molecules/WebsiteBuilderCards';
import legacy from '../images/legacy.png'

const Header = () => {
  return (
    <Container p='2em'>
      <HeaderInfo />
      <WebsiteBuilder></WebsiteBuilder>
      <WebsiteBuilderCards image={legacy} heading='Legacy Builder (Deprecated)' paragraph='Manage legacy published website' ></WebsiteBuilderCards>
    </Container>
  );
};

export default Header;
